sap.ui.define([
	"sap/ui/core/mvc/Controller"
], function (Controller) {
	"use strict";

	return Controller.extend("Image.Image.controller.View1", {
		onInit: function () {
			var oView = this.getView();
			var _imageSrc = {
				"File": "data:image/png;base64,"
			}

			var oModelForImage = new sap.ui.model.json.JSONModel(_imageSrc);

			oView.setModel(oModelForImage, "oModelForImage");

		}
	});
});